import React from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ addToCart, totalItems }) {
  const navigate = useNavigate();

  const buttonStyle = {
    border: "none",
    width: "140px",
    height: "260px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "flex-start",
    cursor: "pointer",
    background: "#f9f6f1",
    borderRadius: "15px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.15)",
    textAlign: "center",
    padding: "15px",
    transition: "transform 0.25s ease, box-shadow 0.25s ease",
  };

  const buttonHoverStyle = {
    transform: "translateY(-6px)",
    boxShadow: "0 8px 16px rgba(0,0,0,0.25)",
  };

  const imgStyle = {
    width: "120px",
    height: "120px",
    borderRadius: "15px",
    objectFit: "cover",
    marginBottom: "12px",
  };

  const labelStyle = {
    fontFamily: "'Sansita Swashed', cursive",
    fontSize: "1.1rem",
    fontWeight: "700",
    color: "#5a3e1b",
    background: "#A17557",
    borderRadius: "8px",
    padding: "8px 10px",
    width: "100%",
    boxSizing: "border-box",
    border: "2px solid #4b3715",
    userSelect: "none",
  };

  // Back button style
  const backButtonStyle = {
    background: "#eee",
    border: "none",
    borderRadius: "50%",
    width: "60px",
    height: "60px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
    position: "absolute",
    bottom: "17px",
    right: "100px",
    boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
    transition: "background-color 0.3s ease",
  };

  // Wrapper for grid container to position relative for back button
  const topBarStyle = {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    gap: "10px",
    width: "100%",
    maxWidth: "800px",
    margin: "0 auto 1rem auto",
    padding: "0 1rem",
    position: "relative",
  };

  // State to track hovered button index for animation
  const [hoveredIndex, setHoveredIndex] = React.useState(null);

  const products = [
    { key: "espresso", label: "Espresso", img: espressoImg, gridCol: "1 / 2" },
    { key: "refresher", label: "Refresher", img: refresherImg, gridCol: "2 / 3" },
    { key: "tea", label: "Tea", img: teaImg, gridCol: "3 / 4" },
    { key: "pastry", label: "Pastry", img: pastryImg, gridCol: "4 / 5" },
    { key: "blended", label: "Blended Beverage", img: blendedImg, gridCol: "5 / 6" },
  ];

  return (
    <div style={{ textAlign: "center", paddingBottom: "80px" }}>
      {/* Top bar with back and cart */}
      <div style={topBarStyle}>
        <button
          onClick={() => navigate("/")}
          style={backButtonStyle}
          aria-label="Back to Home"
          title="Back to Home"
          onMouseEnter={e => (e.currentTarget.style.background = "#dcd6cd")}
          onMouseLeave={e => (e.currentTarget.style.background = "#eee")}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="30"
            height="30"
            fill="none"
            stroke="#5a3e1b"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        <CartIcon totalItems={totalItems} />
      </div>

      {/* Product grid */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(5, 1fr)",
          gap: "1.5rem",
          maxWidth: "840px",
          margin: "1rem auto",
          padding: "0 0.5rem",
          background: "none",
        }}
      >
        {products.map(({ key, label, img, gridCol }, index) => (
          <div key={key} style={{ gridColumn: gridCol, justifySelf: "center" }}>
            <button
              onClick={() => navigate(`/${key}`)}
              style={{
                ...buttonStyle,
                ...(hoveredIndex === index ? buttonHoverStyle : {}),
              }}
              onMouseEnter={() => setHoveredIndex(index)}
              onMouseLeave={() => setHoveredIndex(null)}
              aria-label={label}
              title={label}
            >
              <img src={img} alt={label} style={imgStyle} />
              <div style={labelStyle}>{label}</div>
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
